INSERT INTO "index_announcement" VALUES(32, 'The Red Tide Training Trip Slog: T-1
(click on announcements for the blog)', 'Wednesday Feb. 14: The official Red Tide Training Trip slog begins here.  Check back on a daily basis for new entries and photo galleries.  Today it is snowing and ice pelting in Manhattan... Tonight it will be -3 degrees.   By Thursday night, the training trip crew will be in sunny Mexico, hopefully swimming between 4-6 if we make our connections!  check our photo gallery (click on photo gallerys on the menu bar to the left) to drool over the pool and our luxurious house.', 'Viva Acapulco!  The Red Tide Training Trip Slog', '2007-02-14', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(33, 'Training Trip Slog:  Day 1
(click onannouncements to continue the SLog)

', 'Thursday 2/15: So, the Red Tide Training Trip made it out of NYC (thank god!), but as of this posting we''re 45 minutes away from our destination.  However, Mexico City is showing us a great time! So sophisticated and cosmopolitan!--  Having escaped the snow storm in New York and a airport computer crash at LaGuardia, the team went through a first dry land exercise - a brisk run through the Dallas airport. The team repeated the exercise at the Mexico City Airport - running between the gates, climbing stairs, communicating in sign language with the locals and befriending immigration officers. The team was rewarded with a free dinner at the FREEDOM restaurant. That''s when the drinking began...\r
\r
After several margaritas and beers with the head coach (our hero), we''re now anxiously awaiting our next bottle of wine and the arrival of our revered team president and boy toy in tow. Not to worry.  We''ve had much entertainment from the back slappin'' sales guys next door and their hi-res \"slappin'' that tight ass\" video show.  Doubt that would fly with the HR department back home. \r
 \r
', 'Almost Acapulco!', '2007-02-15', '2007-03-31', 1, 0, '');
INSERT INTO "index_announcement" VALUES(34, 'Training Trip Day 2

(Continue reading the rest of today''s slog on the announcements link on the menu bar on the left.)', 'Friday 2/16: Team Red Tide Acapulco stumbled out of their cliff side lair with only a few hours of sleep after yesterday''s epic travel adventure.  The ocean views from the house decks and porches did help ease the pain.  (See photo galleries for pictures from Day 2 -- titled Acapulco or bust).  Coach Eric showed no mercy, however, with an opening set of 8x400 meters.   Kristin and Jeremy had lost their baggage during their epic tour.  Luckily Sam arrived today and picked up Kristin''s bag en route.  Jeremy is still out of luck and in Patrick''s bathing suit.  (check out aforementioned photo gallery.)  \r
\r
Back at the Casa Iguana post morning workout, TRTA caught up on sleep and started fantasizing about margaritas by the pool.  Before the margaritas however, Coach Eric unleashed the second monster set of the day, 400 IMs interspersed with 600 meters of stroke.\r
\r
The margaritas finally materialized and the team concentrated on rehydrating.  \r
\r
Wish you were here...', '12,000 Glorious Meters', '2007-02-16', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(35, 'Acapulco Day 3!
Continue reading on the announcements link on the left.', 'Saturday 2/17:  If Tyrone were here, we know that''s what he''d be saying.  The pictures of the house don''t do it justice.  We''re trying to do our best Red Tide Real World imitation.  Jeremy and Kristin are sleeping with Patrick and Sam; Caleb, Tracy and Jane are sharing the bunkhouse; and Eldar and Spencer are sharing Cliff and Erin''s suite
All were a bit sore from yesterday''s brutalizing by Eric, but ready to grab the bull by the horns with our 27 X 100 main set- only 6 of which were NOT fast.  The surroundings at Casa Iguana again proved outstanding.  The Mexican lifestyle certainly doesn''t quite understand our need for food IMMEDIATELY upon arriving home, although when it does arrive it is always satisfying.  \r
Until then, stay warm!\r
\r
', 'THAT''S What I''m Talking About!', '2007-02-17', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(36, 'JJ pool will be open tomorrow (Monday).  Practice is on. ', '', 'JJ President''s Day', '2007-02-18', '2007-02-19', 1, 0, '');
INSERT INTO "index_announcement" VALUES(37, 'How have we forgotten to mention The Bus that takes us around? Read on, dear reader. . .
(Click on announcements and don''t forget Eldar''s photos on the photo gallery!)', 'Sunday 2/18: The vehicle in which we are ferried around by the patient, gracious staff of Casa Iguana (and yes, Eric turns out to be an amazing picker-outer of iguanas on cliff faces - how does he DO that?) is a white bus with red stripes, of indeterminate age (late 1960s?). Someone has painted Jehovah Is My Shepherd above the inside windows, and someone else has decorated the old seats with schoolbus-ese like Maria y Juan (heart heart). It rides pretty bumpy ("pretty bumpy?" asks one editrix ,"I''d say Beyond Bumpy"), and, as some of us discovered on a recent taxi ride in the ''hood, has been noticed by the cabdrivers that serve the road connecting Acapulco and its quieter beach-town neighbor, Pie de la Cuesta: "Oh," said the driver when we explained where we were staying, "the group from the bus." Mm-hm, that''s us, the group on the bus. [See photo for bus picture]. 

What we see out the window is an unsettling combo of gorgeous (cliffs, ocean, light) and distressing. As one Red Tider emailed friends today, "Casa Iguana is even more luxurious than it looks in pictures. And just across the street from the house people live in spartan conditions, skinny dogs are scavenging for food on the trash littered  sides of the road, and every now an then you see a truck or two filled with soldiers carrying automatic guns. But no time for social commentary - I have a massage appointment in a few."

Speaking of massage: it was a welcome counterbalance to the mounting casualties. Beyond the sore shoulders (bo-ring, bo-ring) -- Erin: sunburn. Cliff: squishy elbow (diagnosis: bursitis). Carmen: skinned knee. Eldar and Jane: lane line abrasions. Michelle: suit chafing and sit-up scabs ("I have a strange bone that sticks out.") Sam: Lower back. Patrick: near miss with a (now-vanquished by tennis shoe) scorpion. Kristin: pillow wrinkles ("They went away! I can''t believe you wrote that!). Eric: mild stomach upset. 
', 'And when we''re not swimming or recovering. . . ', '2007-02-18', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(38, 'Monday, President''s Day, but not here
(click on announcements to read on)', 'Tuesday 2/20: Sorry we missed the slog entry yesterday, it was not because our Communist comrade deep within the bunker shut us up, but the cliff diving spectacle and a late dinner did us in. Any maybe the 8 x 100 test set.  (Caleb, from the Boston Minutemen team, swam them all Fly!) Plus to top it off,  Jeremy was back in Patrick''s bathing suit.

The team went straight from the pool to the evening out, necessitating showers at the pool. At least on the girls side we vowed never to complain about JJ again.  Some of the cliff divers caught the eye of some of our teammates...  Dinner was at a seafood restaurant.  Erin wouldn''t eat much of anything that came with it head and eyeballs still on.  Eric still wasn''t filling well, so Team Red Tide Acapulco was not up to its usual championship eating form. Spencer holds the local record so far...', 'Cliff Diving, but not what you think', '2007-02-20', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(39, 'It''s Mardi Gras in Mexico!
(click on announcements to read the Slog)', 'Wednesday 2/21: Team Red Tide was feeling quite abused this morning.  Coach Eric showed no favorites with an ugly set of (4 x200 followed by 4  50''s stroke) x 3 on very tight intervals.   Kara was nursing her shoulder and was soon joined by others.  We said goodbye to Sam, who unfortunately took her BodyGlide and sense of humor back to NY with her.  Eldar was one of the stars of the test set so he moved up a lane today.  Cliff''s puss-filled elbow continued to grow in size. 

Most of the team went to the beach today.  Carmen and Libby stayed back at the Casa after venturing out every other day.  Erin got totally sunburned.  Spencer (new nickname of Answer Man) caught up on sleep.

Rowan and Tracy, our Red Tide Fashionistas, led the way to the local beach, along with Jane, Kristin, Mariya, Patrick, Jeremy, and Caleb.

Finally, Coach Eric showed some mercy.  We swam 4,000 meters, but most of it kicking with fins, or drilling. 

At the last dinner in Casa Iguana, the combination of good food, great company and a couple of drinks, made for a perfect Mardi Gras.

Check back for updates and photo galleries!

', 'Martes Grasa!', '2007-02-21', '2007-03-31', 1, 1, '');
INSERT INTO "index_announcement" VALUES(41, 'The final distance was totalled up today and, yes,  the Red Tide Acapulco Training Trip broke the magic 50,000 meter mark...
(click on Announcements to continue reading)', 'Wednesday 2/21: The team averaged  10,000 meters per day. To swim that much, you have to consume a lot of calories.  For awhile, the situation at Casa Iguana was looking a bit like Lord of the Flies.  But we asked the cooks to increase the calorie count, and we reverted to sharing, not hoarding.  There are some champion eaters on this team --  Spencer and Patrick may take the lead.  Jeremy talks a good story about lots of junk food, but can''t come close to Spencer for sheer consumption.

Some of the fave foods included:  French Toast, the cheesey tortillas, chile rellenos, margaritas...

The food fest continued on the way home, where a friendly waiter at the DFW airport described the lovely ladies accompanying Patrick at dinner as "beasts."  It was taken as a compliment.

Speaking of food, the final dinner was very festive. Coach Eric regained his health and led the team in a series of post dinner liquid exercises.  Eldar provided a special tribute to "la muchacha Kristina" by donning a white speedo and doing his best impersonation of the Acapulco cliff divers.

We''re impressed by the hard work of the NY Red Tide Training Trip (doubles plus dryland!).  Check out their photo gallery.

More photos to come and can''t wait to see all of you.', '51,000 meters!', '2007-02-23', '2007-03-31', 1, 1, '');
