INSERT INTO "swimmers_boardposition" VALUES(1, 'President', 'The Board President.  Goes to all the meetings.  Yells at Fred when required');
INSERT INTO "swimmers_boardposition" VALUES(2, 'Vice-President', 'Like the president but Vice');
INSERT INTO "swimmers_boardposition" VALUES(3, 'Secretary', 'Goes to all the meetings.  Secretes.');
INSERT INTO "swimmers_boardposition" VALUES(4, 'Treasurer', 'Goes to all the meetings.  Rolls around in big piles of money at night.');
CREATE TABLE "swimmers_coach" (
  "swimmer_id" int(11) NOT NULL default '0',
  "title" varchar(255) NOT NULL default '',
  "bio" longtext NOT NULL,
  "is_active" tinyint(1) NOT NULL default '0',
  PRIMARY KEY  ("swimmer_id")
);
INSERT INTO "swimmers_coach" VALUES(4, 'A', 'Adam joined Red Tide as a swimmer in January of 2005 and started coaching in July 2005. He has a long swimming background with Curl-Burke, a Washington DC area USS team. In addition, he played club water polo in college and participated in many open water races as a lifeguard on the Jersey Shore. Currently Adam is working on his PhD in Mathematics at the CUNY Graduate Center.', 1);
INSERT INTO "swimmers_coach" VALUES(14, 'A', 'Brett Fisher joined Red Tide in March of 2006. As a sprint enthusiast he has been known to sprinkle a little fun into practice as long as it is associated with the word \"lactate.\" Brett''s philosophy is to create \"smarter\" swimmers and believes that the best sets are not always the longest ones. Brett is currently working on a petition to get a 25-yard stroke and 50-yard IM event adopted into masters swimming. Why not 25''s? Brett swam at Johns Hopkins University and enjoys staying active by playing soccer, boxing, and running.', 1);
INSERT INTO "swimmers_coach" VALUES(81, 'A', 'Jeremy Fain began competitive swimming at the age of 6 during the summers for Daleview Swimming Pool in Silver Spring, MD. At 12 he began year round USS competition with Rockville Montgomery Swim Club (RMSC). At 15 he made his first Junior Nationals qualifying times in the 50 and 100 free. He has always been, and always will be, a sprinter. Jeremy swam all four years in college at Yale University and started as a Red Tide swimmer in the fall of 2003. He began coaching for the team in 2004 and looks forward to another great season for Red Tide. Jeremy does not like doing open water swims but encourages and appreciates all others that do them.', 1);
INSERT INTO "swimmers_coach" VALUES(150, 'H', 'Eric Mitchell was born in Westchester, New York. His swimming career started with the Mt. Kisco Marlins, where he swam for 11 years. Mitchell is a 2 time NYSHS (New York State High School) championship finalist, 8 time National Age Group qualifier and 9 time Junior National qualifier. Mitchell graduated from Old Dominion University in May 2002. While at O.D.U. Eric was a multiple CAA conference championship finalist as well as a 2 time captain of the men''s team. Eric enjoys fishing, camping and brewing beer.', 1);
INSERT INTO "swimmers_coach" VALUES(211, 'A', 'Tyrone is a New York City native. He started to swim competitively at age seven at the local YMCA in the Bronx.  At age twelve he joined the West Side Y Marlins.  There he became a 2-time YMCA State Champion in the 100 fly, YMCA National qualifier, and Junior National qualifier.  Tyrone graduated from Saint Bonaventure University in 1997 where he won two A-10 championships and was a perennial finalist in the 100 and 200 fly. He joined Red Tide in November 2005 as a swimmer and began coaching in September 2006.  He believes that technique and the nuances of swimming make a faster and smarter swimmer. ', 1);
