INSERT INTO "mailinglist_rtmessage" VALUES(6, 108, 7, 'Hello All -=20

The coaches have all weighed in on the problem that we have with Sarah Grof=
f
Palermo.  For those of you who were not previously on the BOD, last year,
Jon Silver was asked to speak with Sarah because of all the complaints we
were receiving.  She was toxic.  I thought that she had turned over a new
leaf, because from where I swim in the pool, I had no idea that this was
still going on.  A whole new litany of complaints have come in and we need
to agree on a procedure to deal with her.

I spoke with Michelle this morning who volunteered to speak with her at
Saturday=B9s workout.  However, we need to have a board consensus on our
policy.  Michelle and I thought that we would present her with specific
actions that are not acceptable from both a coaches and swimmer=B9s
perspective.  As we have already spoken about this with her =AD the question
is =AD How many more chances do we allow her? One, two, three strikes?

I am sorry that it has come to this again with Sarah but the team cannot
tolerate behavior that is so destructive to others.

Please write in with your concerns, ideas etc.

Kristin
', 'SGP', '2007-02-28');
INSERT INTO "mailinglist_rtmessage" VALUES(7, 216, 7, 'Having spent an entire week with SGP during our psychotic NY training trip, 
I can say that she is both a) definitely the biggest pain in the a#@ on the 
team and b) probably one of the most dedicated swimmers I''ve met.  
Unfortunately, her disruptive tendencies really take over when she is in the 
pool, much to her own and everyone else''s detriment.  Over the past two 
weeks, I''ve had several conversations with her about how inappropriate and 
frankly irrational her behavior can be.  (Clearly, to no avail.) I don''t 
know if her issues are truly pathological or if she would respond to another 
conversation.

I''m sorry that Sarah has such problems outwardly being a team player because 
Red Tide and swimming in general seem to mean so much to her.  She goes to 
all the meets, events, etc., she owns every swimming DVD out there (believe 
it or not), she checks the USS web site DAILY, and she talks about swimming 
and the team non-stop. Somewhere beyond all that loud talking and the 
abrasive attitude is someone who really enjoys being with her teammates.

But as a policy matter, we need to decide whether one individual should be 
allowed to cause so many problems over such an extended period of time.  The 
answer seems clear enough and our teammates and the coaches would be 
relieved to have the issue resolved once and for all.

I agree that it would be good to have Kristin and Michelle talk to her as 
that would underscore the finality of the warning.





