INSERT INTO "mailinglist_rtmessage" VALUES(18, 151, 7, 'I did not intend the issue of accommodating schedules to put forth on the public forum which is why I directed my original email to Kristin and not the entire board and responded individually to Michelle regarding her response.
 
This issue has nothing to do with the commitment and competency of individual board members.  The email that Kristin sent out clearly stated that she was accommodating Michelle''s request to have the meeting on Saturday.  From where I sit, that''s overlooking the request of 3 board members who requested not to have the meeting at that day/time.  (If anyone would like to see that email I will be happy to forward it)
 
This is a board comprised of eight people and I would hope that the level of commitment is pretty much equal among the eight of us.
 
If this is going to escalate into finger pointing and vilifying of any dissenting opinion, then I am going to have to re-think my commitment to this type of atmosphere.
 
Martha
