al board members.  The email that Kristin sent out clearly stated that she =
was accommodating Michelle''s request to have the meeting on Saturday.  From=
 where I sit, that''s overlooking the request of 3 board members who request=
ed not to have the meeting at that day/time.  (If anyone would like to see =
that email I will be happy to forward it)
=20
This is a board comprised of eight people and I would hope that the level o=
f commitment is pretty much equal among the eight of us.
=20
If this is going to escalate into finger pointing and vilifying of any diss=
enting opinion, then I am going to have to re-think my commitment to this t=
ype of atmosphere.
