INSERT INTO "mailinglist_rtmessage" VALUES(20, 151, 7, 'I hope we can agree to put aside the meeting issue -- agree to in the future finding a time/day when most of the board who wish to attend can.
 
I think the other two issues -- SGP and Eric''s comment deserve some serious thought as those two matters concern the entire team and not just the 8 of us.
 
Was anything resolved with SGP?  Michelle, did you have an opportunity to speak with her?
 
I''ve given Eric''s comments some thought and came up with the following:
 
1.  Are any of us guilty of doing the things he''s talking about?  I will sheepishly admit to saying things like "this interval is too fast/slow" or whining about sprinting.  But I''m not sure if those are the types of things he means. 
2.  If the answer to the above is yes and yes -- then, obviously change has to start from the top down.  Has anyone else noticed people doing what Eric is talking about?  Should we as board members speak up if we hear such things being said?
 
3.  I would be interested to know if Eric has noticed this type of thing increasing since competition season has officially started.
 
4.  Having come from a team that was not so compeitition oriented, the first thing I noticed about this team that as a whole, the team works itself up into a collective competition hyper-drive (across all lanes) from February through Nationals.  Perhaps all that energy just kind of boils over.  Would it make sense (and I know it''s a financial strain) to have 2 coaches on deck for some of the more crowded practices from now through May? Perhaps an extra coach would take some of the pressure off and allow more attention to be paid to each lane and direct the energy to a more positive outcome.
 
What are the other thoughts on this?
 
Thanks
Martha
 
 
 
________________________________________________________________________
